import React,{FC} from 'react';
import './Button.css';

interface ButtonProps {
    children:React.ReactNode;

    
}

const Button:FC<ButtonProps> = ({children}) => {


    function ButtonSubmit(e:React.MouseEvent) {
        e.preventDefault();
        alert('Клик на'+children)

    }

    return (

        <button onClick={ButtonSubmit} type="submit">{children}</button>
    );
};

export default Button;
